import React, { Component } from "react";
import Layout from "../components/Layout";
import Detail from "./detail";

class Index extends Component{
    render(){
        console.log(this.props.blogs);
        return(
            <Layout>
                <div className="container">
                    <div className="text-center">
                        <h1 className="mb-1" >WHO WE ARE</h1>
                        <h4>Game Developer and Video Creater</h4>
                        <p className="text-left">Nowadays a workplace can outsource almost every task, and outsourcing IT services is no exception. Tek Def can help take the weight off your shoulders so your business can focus on key functions while the crucial IT tasks are managed by our professionals. Our umbrella of IT outsourcing services are summed up in the blow categories. Click on one for more information.</p>
                    </div>                   
                    <div className="row d-flex justify-content-center">
                        <Detail title1 = "About1" />
                        <Detail title1 = "About2" />
                        <Detail title1 = "About3" />
                        <Detail title1 = "About4" />
                        <Detail title1 = "About5" />
                        <Detail title1 = "About6" /> 
                    </div>
                </div>          
            </Layout>               
        )
    }
}

export default Index;
